import React from "react";
import { Card, CardContent, Grid } from "@mui/material";

export const Form = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={4}></Grid>
      <Grid item xs={4}>
        <Card>
          <CardContent>
            <h3>Sign In </h3>
            <p>UserNmae:</p>
          </CardContent>
        </Card>
      </Grid>
      <Grid item xs={4}></Grid>
    </Grid>
  );
};
